import React, { useState } from 'react';
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";
import "./App.css";
import NavbarVideo from './components/NavbarVideo';
import Navbar from './components/Navbar';
import AffichageCarte from './components/AffichageCarte';
import Contact from './components/Contact';
import BodyHome from './components/BodyHome';
export default function App() {
  return (
    <>
      <Router forceRefresh={true} >
        <Switch>
          <Route exact path="/" component={Home}/>
          <Route exact path="/Explore" component={Explore}/>
          <Route exact path="/A-propos" component={Apropos}/>
          <Route exact path="/Contact" component={ContactF} />
          <Route exact path="/2012" component={Carte2012} />
          <Route exact path="/2007" component={Carte2007} />
          <Route exact path="/2002" component={Carte2002} />
          <Route exact path="/1995" component={Carte1995} />
          <Route exact path="/1988" component={Carte1988} />
          <Route exact path="/1981" component={Carte1981} />
          <Route exact path="/1974" component={Carte1974} />
          <Route exact path="/1969" component={Carte1969} />
          <Route exact path="/1965" component={Carte1965} />
        </Switch>
      </Router>
    </>
  );
}
function Home() {
  return (<React.Fragment>
    <NavbarVideo />
    <BodyHome />
  </React.Fragment>);
}
function Explore() {
  return (<React.Fragment>
    <Navbar />
    <BodyHome />
  </React.Fragment>);
}
function Apropos() {
  return (<React.Fragment>
    <Navbar />
  </React.Fragment>);
}
